import React from "react";
import Starter from "../Category/Starter";
import "./secondpage.css";

const SecondPage = () => {
  return (
    <div>
      <h1>Second Page</h1>
      <div className="Container">
        <div className="MenuList">
          <Starter />
        </div>
        <div className="RightSidebar"></div>
      </div>
    </div>
  );
};

export default SecondPage;
